window.bookSummaryJSON = "<p><b>Meghan can't afford to take a break.</b></p> <p>She's gotten food and shelter for her family. Her oldest is turning into a wizard, her middle boy is some kind of self-healing monkey, and her youngest is accumulating a small army of pets. That's a bit much to roll with, but when monsters are appearing on the lawn, it's probably for the best.</p> <p>What worries her is the mysterious—and dangerous—\"challenge\" she knows is fast approaching, and she's got to get her kids and community ready to face it. Some neighbors are ready and willing to pitch in, but others? They might end up being a bigger problem than the alien monsters.</p>"; 
